import { React } from 'react';
import OAuth from '../Auth/OAuth';
import FolderStructure from '../FolderStructure/FolderStructure';
import Icon from '../Elements/Icon';
import styles from './main.module.css';
import Button from '../Elements/Button/Button';

export default function Main() {
	function handleCreateProject() {
		window.location.href = '/folder-structure/create';
	}

	function handleCreateTemplate() {
		window.location.href = '/template/create';
	}

	function handleViewTemplates() {
		window.location.href = '/template/view';
	}

	return (
		<>
			<div className={styles.mainNav}>
				<div className={styles.leftSide}>
					<span className={styles.logo}> {Icon.logo}</span>

					<span className={styles.projectName}>Solutions Accelerators</span>
					<span className={styles.beta}>Beta</span>
				</div>

				<div className={styles.rightSide}>
					<a
						href="https://dbx-solutions.github.io/dsx/"
						target="_blank"
						className={styles.navLink}
					>
						Documentation
					</a>
					<a
						href="https://github.com/dbx-solutions"
						target="_blank"
						className={styles.navLink}
					>
						Code
					</a>

					<OAuth />
				</div>
			</div>

			<div className={styles.taglineContainer}>
				<div className={styles.leftSide}>
					<span className={styles.tagline}>Folder Templates</span>
				</div>

				<div className={styles.rightSide}>
					<Button
						icon={Icon.plus}
						caption="Create project from template"
						color="blue"
						handleOnClick={handleCreateProject}
					/>
					<Button
						icon={Icon.plus}
						caption="Create template"
						color="gray"
						handleOnClick={handleCreateTemplate}
					/>
					<Button
						icon={Icon.template}
						caption="View all templates"
						color="gray"
						handleOnClick={handleViewTemplates}
					/>
				</div>
			</div>
		</>
	);
}
